import React from 'react';
import Button from './signUpPage.style';
const SignUpPage = () => {
    return (
        <div>
            <button>Back to home page</button>
            <div>
                <h3>Be a part of Capybana Community</h3>
                <h1>Sign up</h1>
                <form action = "somewhere" method = "POST">
                    <label for = "username">Username:</label>
                    <input type = "text" id = "username" placeholder = "capybana" minlength = "6" maxlength = "30" required></input><br></br>
                    <label for = "password">Password:</label>
                    <input type = "password" id = "password" minlength = "8" maxlength = "30" required></input><br></br>
                    <label for = "cfpassword">Confirm Password:</label>
                    <input type = "password" id = "cfpassword" minlength = "8" maxlength = "30" required></input><br></br>

                    <Button>Sign up</Button>
                </form>
            </div>
        </div>
    );
}
export default SignUpPage;
